import express from "express"
import bodyParser from "body-parser"
import {v4 as uuidv4} from "uuid"

const app=express()
const port=3000
app.use (bodyParser.json())
var tempStorage=[]

app.get("/dohvatiArtikle",(req,res)=>{
    var artikli=tempStorage.filter(data=>data.cijena>30)
    console.log(artikli)
    res.send(artikli)
})
app.post("/dodajArtikl",(req,res)=>{
    var data=req.body
    data.id=uuidv4()
    data.cijena=Math.floor(Math.random() * 100) + 1
    tempStorage.push(data)
    res.send(tempStorage)
})
app.patch("/urediArtikl/:id",(req,res)=>{
    var {id}=req.params
    var data=req.body
    var {cijena}=req.body
    var art=tempStorage.find((data)=>data.id==id)
    art.kljuc_status=uuidv4()
    art.cijena=cijena
    console.log(art)
    res.send(tempStorage)
})
app.delete("/izbrisiArtikl",(req,res)=>{
    var {id}=id.params
    tempStorage=tempStorage.filter(x=>id!==id)
    res.send(tempStorage)
}) 
app.listen(port,()=>console.log(`Work on port ${port}`))

